import React from "react";
// import "../assets/style.css";

const Header = () => {
  return (
    <div className="name">
      <h1>
        Nickolas&nbsp;<i>'Nick'</i>&nbsp;&nbsp;Ezell
      </h1>
      <hr />
    </div>
  );
};

export default Header;
